        ctx.setPin("S", [bigInt(ctx.getVar("nInputs",[])).add(bigInt(ctx.getVar("i",[]))).mod(__P__)], "k", [], ctx.getSignal("k", []));
        ctx.setPin("S", [bigInt(ctx.getVar("nInputs",[])).add(bigInt(ctx.getVar("i",[]))).mod(__P__)], "xL_in", [], ctx.getPin("S", [bigInt(bigInt(ctx.getVar("nInputs",[])).add(bigInt(ctx.getVar("i",[]))).mod(__P__)).add(__P__).sub(bigInt("1")).mod(__P__)], "xL_out", []));
